import React from "react";
import "./DietaryIcon.css"; // Crea un archivo CSS para personalizar los estilos.

const dietaryIcons = {
  vegetarian: "/icons/vegetarian.png",
  vegan: "/icons/vegan.png",
  glutenFree: "/icons/gluten-free.png",
  dairyFree: "/icons/dairy-free.png",
  ketogenic: "/icons/keto.png",
  pescatarian: "/icons/pescatarian.png",
  // Añade más restricciones y sus imágenes si es necesario.
};

const DietaryIcon = ({ diet }) => {
  const icon = dietaryIcons[diet] || "/icons/default.png"; // Ícono por defecto.
  return (
    <div className="dietary-icon">
      <img src={icon} alt={diet} className="icon-image" />
      <span>{diet}</span>
    </div>
  );
};

export default DietaryIcon;
